import React from 'react'
import {Wrapper, H1} from '../Styled';
import Input from './Label';

import styled from "styled-components";

const Form = styled.form`
    border: 2px solid var(--s-3);
    border-radius:.5em;
`

export default function Contact() {
    return (
        <Wrapper>
            <H1>Contact</H1>
            <Form>
                <Input name="name">

                </Input>
            </Form>

        </Wrapper>
    )
}
